import {Menu} from  "antd";
import React from 'react'

const Dropmenu = () => {
  return (
    <div>
       <Menu
       items={[
        {
          label: (
          <a target="_blank" rel="noopener noreferrer" href="https://www.antgroup.com">
            1st menu item
          </a>
        ),
          key:"dashboard",
          children:[
          {label:"revenu",Key:"rev"}, 
          {label:"revenu",Key:"exp"}, 
        ]},
       ]}
       >

       </Menu>
    </div>
  )
}

export default Dropmenu;
